import styled from 'styled-components';

export const Header = styled.header`
  display: flex;
  justify-content: center;
  background-color: #fff;
  position: sticky;
  top: 0;
  -webkit-box-shadow: 0px 6px 6px 2px rgba(50, 50, 50, 0.8);
  -moz-box-shadow:    0px 6px 6px 2px rgba(50, 50, 50, 0.8);
  box-shadow:         0px 6px 6px 2px rgba(50, 50, 50, 0.8);
`;
